webpackJsonp([43280988194671],{9147:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Deng",date:"17 Jun 2001",slug:"/2001-06-17-deng/",tags:"Y2001"},html:"<p>Best wishes to Roland and Kirsten, Mama's brother and sister-in-law, who announced to the family today that they are expecting a 3rd child in November. </p>\n<p>In the spirit of stressed-out parents, I've uploaded a new layout that's only half finished. I've stolen the Tagesm√ºtter logo; it seems to fit us somehow. I still need to work out where to put the calendar and the favorite links. Putting text over the colored stripes is not a good option</p>\n<p>Christopher's word of the day is 'deng'. This apparently is an exclamation to be made when any object, including Christopher himself, falls to the floor with a thud. Deng.</p>"},next:{fields:{title:"New Doo",date:"16 Jun 2001",slug:"/2001-06-16-new-doo/"}},previous:{fields:{title:"Happy Monday",date:"18 Jun 2001",slug:"/2001-06-18-happy-monday/"}}},{node:{fields:{title:"New Doo",date:"16 Jun 2001",slug:"/2001-06-16-new-doo/",tags:"Y2001"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/06/crhdoo.jpg" height="289" width="300" border="0" alt="crhdoo.jpg: " /></p>\n<p>Christopher got a haircut today. Too many people thought he was a girl.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/06/crhrootprompt.jpg" height="225" width="300" border="0" alt="crhrootprompt.jpg: " /></p>\n<p>Here he is at work on my Linux computer. I think he\'s trying tohack my root password.</p>'},next:{fields:{title:"Burning Rubber",date:"14 Jun 2001",slug:"/2001-06-14-burning-rubber/"}},previous:{fields:{title:"Deng",date:"17 Jun 2001",slug:"/2001-06-17-deng/"}}},{node:{fields:{title:"Burning Rubber",date:"14 Jun 2001",slug:"/2001-06-14-burning-rubber/",tags:"Y2001"},html:'<p>Here\'s another entry for the \'differences between the US and Europe\' file. McDonald\'s Germany co-publishes a monthly movie magazine <a href="http://www.kinonews.de">KinoNews</a> that is distributed in the restaurants and is aimed at teenagers. This month they are advertising a contest for VIP-Tickets to the <a href="http://www.loveparade.de">Love Parade</a> in Berlin. The contest is <a href="http://www.durex.de/de/htm/durex_news.html">sponsored by Durex</a>, a brand of condoms. Would McDonald\'s USA hang posters advertising condoms to teenagers in their restaurants? I doubt it...</p>'},next:{fields:{title:"",date:"12 Jun 2001",slug:"/2001-06-12-super-tagesmuetter/"}},previous:{fields:{title:"New Doo",date:"16 Jun 2001",slug:"/2001-06-16-new-doo/"}}}],pathPrefix:"",first:!1,last:!1,index:997,pageCount:1101}}}});
